import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <div className="navbar">
      <h1>FinFin</h1>
      <ul>
        <li><Link to="/quiz">Quiz</Link></li>
        <li><Link to="/personality">Personality</Link></li>
        <li><Link to="/about">About</Link></li>
      </ul>
    </div>
  );
};

export default Navbar;
